int OtherExists(char *charSCC,char *geometry,char *charSAC,char *targetvalue)
{
  int i,j,thisindex,thatindex;
  char thisvalue[1000];

  for(i=0;i<NumberOfModels;i++)
  {
    if((!strcmp(MdlNames[i].name,geometry)) && (!strcmp(GetECCLabel(MdlNames[i].code),charSCC)))
	{	  
	  for(j=0;j<MdlNames[i].numattributes;j++)
	  {
        thisindex = MdlNames[i].AttrIndices[j];
        thatindex = MdlNames[i].ValueIndices[j];

        if(!strcmp(GetEACCode(MdlNames2[thisindex].code),charSAC))
		{
          if(MdlNames2[thisindex].values[thatindex].type==3)
		  { 
		    sprintf(thisvalue,"%s", 
			    GetEELabel(
				     MdlNames2[thisindex].code,
				     (int)MdlNames2[thisindex].values[thatindex].value));
		  } 
		  else
		  { 
            continue;
		  } 
		  
		  if(strcmp(thisvalue,targetvalue))
		  {
            
            return 1;
		  }  
		}  
	  }   
	}   
  }   
  return 0;
}





int FindNAM(char *geometry,char *charSCC,char *targetvalue)
{
  double Dval;
  int i,thistype,thisgeom,thisecc,Ival,tgtgeom,ecc_index=-1;
  char cleancode[1000];



  if(
   (strcmp(charSCC,"AL020"))&&
   (strcmp(charSCC,"AL105"))&&
   (strcmp(charSCC,"AP030"))&&
   (strcmp(charSCC,"ZD040"))
   )
  { 
    return 0;
  } 

  if(!strcmp(geometry,"(POINT)"))
  {
    tgtgeom = C_POFE;
  }
  else if(!strcmp(geometry,"(LINE)"))
  {
    tgtgeom = C_LINE;
  }
  else if(!strcmp(geometry,"(AREA)"))
  {
    tgtgeom = C_AREA;
  }
  else
  {
    printf("Error: bad geom %s to FN\n",geometry);
	return 0;
  }

  ecc_index = GetCodeIndex(charSCC);

  if(ecc_index<0)
  {
    return 0;
  }


  for(i=0;i<LLFidTableCount;i++)
  {

  	if(LLFidTable[i]<0)
	{
	  continue;
	}

    thistype = GetLongAttrVal(LONG_ATTR_NAM,i,&Ival,&Dval,&cleancode[0]);

	thisecc  = SCCtable[CrsWlk[LLFidTable[i]].LtoSmapping].ECC;
	thisgeom =          CrsWlk[LLFidTable[i]].geomtype;

	if(thisgeom!=tgtgeom)
	{
	   continue;
	}

   if(thisecc!=ecc_index)
	{
	  continue;
	}


	if(thistype==C_TYPE)
	{
	  if(!strcmp(cleancode,targetvalue))
	  {
        return 1;
	  }
	}
  }

  return 0;

}


int FindAttr(double dval,int passtype,char *geometry,char *charSCC, char *charSAC, char *targetvalue)
{
  int i,j,thisindex,thatindex;
  char thisvalue[1000];
  

  if((ATTRTYPE_SAC()==0) && (ATTRTYPE_NFDD()==0)) 
  {
    if(!strcmp(charSAC,GetLongCode(LONG_ATTR_NAM)))
	{ 
      
      return FindNAM(geometry,charSCC,targetvalue);
	} 
  }


  
  
  
  


  for(i=0;i<NumberOfModels;i++)
  {
    if((!strcmp(MdlNames[i].name,geometry)) && (!strcmp(GetECCLabel(MdlNames[i].code),charSCC)))
	{	 

	  if(passtype==FIND_CODEGEOM)
	  {
	    return 1;
	  }

	  for(j=0;j<MdlNames[i].numattributes;j++)
	    {	  
	      
	      thisindex = MdlNames[i].AttrIndices[j];
	      thatindex = MdlNames[i].ValueIndices[j];

	      if(!strcmp(GetEACCode(MdlNames2[thisindex].code),charSAC))
		  {
		  

		    
		    if(  (passtype==FIND_ENUM)  && (MdlNames2[thisindex].values[thatindex].type==3)  )
		      {
			sprintf(thisvalue,"%s", 
				GetEELabel(
					   MdlNames2[thisindex].code,
					   (int)MdlNames2[thisindex].values[thatindex].value));
		      }

		    
		    else if(  (passtype==FIND_STRING)  && (MdlNames2[thisindex].values[thatindex].type==2)  )
		      {
				if(dval==-33)
				{
				  if(
					  (strcmp(MdlNames2[thisindex].values[thatindex].label,"N/A")) &&
					  (strcmp(MdlNames2[thisindex].values[thatindex].label,"UNK")) &&
					  (strcmp(MdlNames2[thisindex].values[thatindex].label,"N_A")) &&
					  (strcmp(MdlNames2[thisindex].values[thatindex].label,"OTH"))
					 )
				  {
                    
					return 1;
				  }
				}
				else
				{
			      sprintf(thisvalue,"%s",MdlNames2[thisindex].values[thatindex].label);
				}
		      }


		    else if(  (passtype==FIND_REAL)  && 
			       (
			         (MdlNames2[thisindex].values[thatindex].type==0) ||
			         (MdlNames2[thisindex].values[thatindex].type==1)
				 )
			      )
		      {
			if(RealClose(dval,MdlNames2[thisindex].values[thatindex].value))
			  {
			    return 1;
			  }
		      }



		    else
		  {
			 
             continue;
		  }


			if((passtype!=FIND_REAL)&&(dval!=-33))
			{
		      if(!strcmp(thisvalue,targetvalue))
			  { 
                return 1;
			  } 
			}
		}
	    }
	}
    }
  return 0;
}



  


