  {
    if((!strcmp(MdlNames[i].name,geom)) && (!strcmp(GetECCLabel(MdlNames[i].code),SCC)))
	{

	  SCCcount = MdlNames[i].occurrences; 

	  for(j=0;j<MdlNames[i].numuniqueAttr;j++)
	  {	
          if(!strcmp(GetEACCode(GetCode(i,j)),SAC))
		  {
	          SACcount = MdlNames[i].UniqueCounts[j]; 
			  break;
		  }
	  }
	}
  }

