char *MakeCleanString(char *oldcode)
{
  static char retcode[1000];
  int i,len,insertindex;

  
  len = strlen(oldcode);
  insertindex = 0;
  
  for(i=0;i<len;i++)
    {
      

      if((oldcode[i]>='A')&&(oldcode[i]<='Z'))
	  {
	    retcode[insertindex]=oldcode[i] + 32;
	    insertindex++;
	  }
      if((oldcode[i]>='a')&&(oldcode[i]<='z'))
	  {
	    retcode[insertindex]=oldcode[i];
	    insertindex++;
	  }
      if((oldcode[i]>='0')&&(oldcode[i]<='9'))
	  {
	    retcode[insertindex]=oldcode[i];
	    insertindex++;
	  }
  }

  retcode[insertindex] = '\0';

  return retcode;
}



