int NUM_Getter(char *attrcode,char *geomstring,char *fcode,double *minVAL,double *maxVAL, 
			   double minaccept,double maxaccept, int filter_out_nulls, 
			   double *smallestOVER, double smalloverlimit,
               double *largestUNDER, double largeunderlimit
			   )
{
  int i,j,thisindex,thatindex,use_it,first=0;
  double min=0,max=0,tempval;

  int findsmallest=0,findlargest=0;

  if(
	  (!RealClose(*smallestOVER,smalljunkflag)) &&
	  (!RealClose(smalloverlimit,smalljunkflag))
	)
  {
    findsmallest = 1;
  }

  if(!RealClose(largeunderlimit,smalljunkflag))
  {
    findlargest = 1;
  }

  for(i=0;i<NumberOfModels;i++)
  {
    if(
		(!strcmp(MdlNames[i].name,geomstring))          && 
		(!strcmp(GetECCLabel(MdlNames[i].code),fcode))
	  )
	{
	  

	  for(j=0;j<MdlNames[i].numattributes;j++)
	  { 	    
	    thisindex = MdlNames[i].AttrIndices[j];
	    thatindex = MdlNames[i].ValueIndices[j];

	    if(!strcmp(GetEACCode(MdlNames2[thisindex].code),attrcode))
		{
		  
		  if(
			  (MdlNames2[thisindex].values[thatindex].type==0) ||
			  (MdlNames2[thisindex].values[thatindex].type==1)
			)
		  {
			tempval = (double)MdlNames2[thisindex].values[thatindex].value;

			if(
				((tempval>=minaccept)||(minaccept==NO_U_MIN))   &&
				((tempval<=maxaccept)||(maxaccept==NO_U_MAX))
			   )
			{

				use_it = 1;

 			   if(filter_out_nulls==1)
			   {
                 if( 
					 (RealClose(tempval,-32764.0)) || 
					 (RealClose(tempval,-32765.0)) || 
					 (RealClose(tempval,-32767.0)) || 
					 (RealClose(tempval,-32768.0))
                   )
				 {
                   use_it = 0;
				 }
			   }
 			   if(filter_out_nulls==2) 
			   {
                 if( 
					 (RealClose(tempval,-32764.0)) || 
					 (RealClose(tempval,-32765.0)) || 
					 (RealClose(tempval,-32767.0))
                   )
				 {
                   use_it = 0;
				 }
			   }

              if(use_it==1)
			  {
			    if(first==0)
				{ 
                  min = tempval;
                  max = tempval;
			      first = 1;
				}  
			    else if(tempval>max)
				{  
                  max = tempval;
				}  
			    else if(tempval<min)
				{  
                  min = tempval;
				}  


				if(findlargest>0)
				{
				  if(tempval<largeunderlimit)
				  {
					if(findlargest==1)
					{
					  *largestUNDER = tempval;
                      findlargest = 2;
					}
					else
					{
					  if(tempval>*largestUNDER)
					  {
                        *largestUNDER = tempval;
					  }
					}			
				  }
				}



				if(findsmallest>0)
				{
                  if(tempval>smalloverlimit)
				  {
					if(findsmallest==1)
					{
					  *smallestOVER = tempval;
                      findsmallest = 2;
					}
					else
					{
					  if(tempval<*smallestOVER)
					  {
                        *smallestOVER = tempval;
					  }
					}
				  }
				}
			  }
			} 
		  } 
		} 
	  } 
	} 
  }

  *minVAL = min;
  *maxVAL = max;

  return first;
}









