int UseLineTrans(int code)
{
  

  char label[1000];

  sprintf(label,"%s",GetECCLabel(code));

  if(!strcmp(label,"Cart Track"))                   { return 1;}
  if(!strcmp(label,"Ferry Crossing"))               { return 1;}
  if(!strcmp(label,"Ice Route"))                    { return 1;}
  if(!strcmp(label, GetInterchangeName(1)))         { return 1;}
  if(!strcmp(label, GetRailName(1)))                { return 1;}
  if(!strcmp(label, GetSideTrackName(1)))           { return 1;}
  if(!strcmp(label, GetRoadName(1)))                { return 1;}

  return 0;
}


