char *GetDeg(double spacing)
{
  if(RealClose(spacing,1))
  {
    return "one";
  }
  if(RealClose(spacing,.5))
  {
    return "one-half";
  }
  if(RealClose(spacing,.25))
  {
    return "one-quarter";
  }
  if(RealClose(spacing,.125))
  {
    return "one-eighth";
  }
  if(RealClose(spacing,.0625))
  {
    return "one-sixteenth";
  }

  printf("Error in GetDeg (%lf)\n",spacing);

  return "error";
}



void DoPART_ISF(
		 int *areaspresent,
		 int type, char *prefix,
		 int area_building_found,
		 int area_bua_found)
{
  FILE *newfile;
  char message[1000];
  int i,j,totalchecks,docheck1;


#define num_secondaries 41
  char *secondaries[num_secondaries]={
"AB000","AB010","AC000","AD010","AD030","AD050","AH050","AI030","AJ030","AK030",
"AK060","AK090","AK100","AK120","AK180","AL010","AL012","AL020","AL030","AL105",
"AL170","AL200","AL208","AM010","AN060","AQ116","AQ125","AQ135","AQ140","AT050",
"BB005","BH050","BH051","DB090","EC020","FA015","FA100","GB005","GB015","GB035","SU001"};

  int ispresent[num_secondaries];
  int codes[num_secondaries];

  if(type==2)
  { 
    

    sprintf(message,"%sPART_ISF.txt",prefix);
    newfile = fopen(message,"w");
    ExeUpdate(message);

    docheck1 = 0;


    if(area_building_found>0) 
	{ 
      for(i=0;i<num_secondaries;i++)
	  {
        ispresent[i] = 0;

        codes[i] = SilentConvertClassCode(secondaries[i]);
	    if(codes[i]>=0)
		{
		  codes[i] = codes[i] + 1;
		  
		  if(areaspresent[codes[i]]==1)
		  {
            ispresent[i] = 1;

			
			docheck1 = 1;
		  }
		}
	  }
	}

    totalchecks = docheck1;

    if(totalchecks>0)
	{
	  
	  fprintf(newfile,"UNIQUE_CHECKS 1\n");
	  fprintf(newfile,"PART_ISF %d\n",totalchecks);

	  j = 1;

	  if(docheck1==1)
	  {
	    fprintf(newfile,"PART_ISF %d C_PRIMARY C_SOME_AREA on\n",  j);
	    fprintf(newfile,"PART_ISF %d C_PRIMARY C_ALL_AREA off\n",  j);

        fprintf(newfile,"PART_ISF %d C_SECONDARY C_SOME_AREA on\n",j);
        fprintf(newfile,"PART_ISF %d C_SECONDARY C_ALL_AREA off\n",j);

		if(area_bua_found>0)
		{
		  fprintf(newfile,"PART_ISF %d ANNOTATION \"Area %s partially overlapping area Site, Facility, or %s\"\n",j,GetBuildingName(1),GetBUAName(1));
		}
		else
		{
		  fprintf(newfile,"PART_ISF %d ANNOTATION \"Area %s partially overlapping area Site, or Facility\"\n",j,GetBuildingName(1));
		}

	    j = j + 1;
	  }

	  fprintf(newfile,"ATTRATTRATTR\n");

	  j = 1;


	  if(docheck1==1)
	  {    
	      
        if(area_building_found>0) 
		{ 
	      fprintf(newfile,"PART_ISF %d PRIMARY %s ANY on C_AREA\n",j,GetBuildingName(0));
		} 

        for(i=0;i<num_secondaries;i++)
		{ 
		  if(ispresent[i]==1)
		  {
	        fprintf(newfile,"PART_ISF %d SECONDARY %s ANY on C_AREA\n",j,MakeCleanCode(GetECCLabel(codes[i])));
		  }
		}



	    j = j + 1;
	  }


	} 
    else
	{
	  fprintf(newfile,"Data not available to specify this check\n");
	}
      fclose(newfile);
  } 




}



