void DoNETISOA(
		 int type,char *prefix,
		 int area_bua_found,
		 int line_road_found,
		 int line_trail_found,
		 int line_ctrack_found)
{
  FILE *newfile;
  char message[1000];
  int docheck1,j,totalchecks;


  if((type==1)||(type==2)||(type==3)||(type==4)||(type==5)||(type==6)||(type==7)||(type==8)||(type==9)||(type==10)||(type==11))
    {
      
      
      sprintf(message,"%sNETISOA.txt",prefix);
      newfile = fopen(message,"w");
      ExeUpdate(message);


      docheck1  = 0; 


      if((type==1)||(type==2)||(type==3)||(type==4)||(type==5)||(type==6)||(type==7)||(type==8)||(type==9)||(type==10)||(type==11))
	  {
	    if(area_bua_found>0)
		{ 
		  if(type==10)
		  {
            if((line_road_found+line_ctrack_found+line_trail_found)>0)
			{
              docheck1 = 1;
			}
		  }
		  else
		  {
	        docheck1 = 1;
		  }
	    } 
	  } 


      totalchecks = docheck1;


      if(totalchecks>0)
	{
	  
	  fprintf(newfile,"UNIQUE_CHECKS 1\n");
	  fprintf(newfile,"NETISOA %d\n",totalchecks);

	  j = 1;

  	  if(docheck1>0)
	    {
	      fprintf(newfile,"NETISOA %d C_PRIMARY C_SOME_AREA on\n",  j);
	      fprintf(newfile,"NETISOA %d C_PRIMARY C_ALL_AREA off\n",  j);
	      
	      fprintf(newfile,"NETISOA %d C_SECONDARY C_SOME_LINE on\n",j);
	      fprintf(newfile,"NETISOA %d C_SECONDARY C_ALL_LINE off\n",j);

          fprintf(newfile,"NETISOA %d INCLUDE_BOUNDARY_CONDITIONS OFF\n",j);
	      fprintf(newfile,"NETISOA %d TOLERANCE_PRIMARY 0.01\n",    j);
	      fprintf(newfile,"NETISOA %d TOLERANCE_SECONDARY 0.01\n",  j);

		  fprintf(newfile,"NETISOA %d ANNOTATION \"Area %s not intersecting line %s, Cart Track, or Trail\"\n",
			  j,GetBUAName(1),GetRoadName(1));

	      j = j + 1;
	    }


      fprintf(newfile,"ATTRATTRATTR\n");


	  j = 1;
	  

	  if(docheck1>0)
	  {
        if(area_bua_found>0) 
		{
	      fprintf(newfile,"NETISOA %d PRIMARY %s ANY on C_AREA\n",j,GetBUAName(0));
		}

        if(line_road_found==1)
		{
	      fprintf(newfile,"NETISOA %d SECONDARY %s ANY on C_LINE\n",j,GetRoadName(0));
		}
  
        if(line_ctrack_found>0)
		{ 
		  fprintf(newfile,"NETISOA %d SECONDARY CartTrack ANY on C_LINE\n",j);
		}
	      
        if(line_trail_found>0)
		{ 
		  fprintf(newfile,"NETISOA %d SECONDARY Trail ANY on C_LINE\n",j);
		} 
        j = j + 1;
	  }

     }
      else
	{
	  fprintf(newfile,"Data not available to specify this check\n");
	}
      fclose(newfile);
    }
}



