void DoNOT_FLAT(
		int type,char *prefix,
		int perrenial_area_lake_found,
		int perrenial_area_iwb_found,
		int perrenial_area_reservoir_found,
		int area_building_found,
		int area_tidal_water_found)
{
  FILE *newfile;
  char message[1000];
  int docheck1,docheck2,docheck3,docheck4,j,totalchecks;

  if((type==1)||(type==3)||(type==4)||(type==5)||(type==6)||(type==7)||(type==8)||(type==11))  
    {
      
      
      sprintf(message,"%sNOT_FLAT.txt",prefix);
      newfile = fopen(message,"w");
      ExeUpdate(message);
      
      docheck1  = 0;
      docheck2  = 0;     
      docheck3  = 0;
      docheck4  = 0;
      
      
      if(Total3DArea>0)
	{
	  if(
	     ((perrenial_area_lake_found==1)||(perrenial_area_iwb_found==1))&&
	     ((type==1)||(type==4)||(type==5)||(type==6)||(type==7)||(type==8)||(type==11))
	     )
	    { 
		  docheck1  = 1;
	    }
	  
	  if(
	     (perrenial_area_reservoir_found==1)&&
	     ((type==1)||(type==4))
	     )
	    {
	      docheck2  = 1;
	    } 
	  
	  if(
	     (area_building_found>0)  &&
	     ((type==3)||(type==4))
	     )
	    {
	      docheck3 = 1;
	    }
	  
	  if((area_tidal_water_found>0) && ((type==5)||(type==6)||(type==7)||(type==8)||(type==11)) )
	    {
	      docheck4 = 1;
	    }
	}


      totalchecks = docheck1 + docheck2 + docheck3 + docheck4;

      if(totalchecks>0)
	{
	  fprintf(newfile,"UNIQUE_CHECKS 1\n");
	  fprintf(newfile,"NOT_FLAT %d\n",totalchecks);
	  
	  j = 1;
	  
	  if(docheck1==1)
	    {	      
	      fprintf(newfile,"NOT_FLAT %d C_PRIMARY C_ALL_AREA off\n",j);
	      fprintf(newfile,"NOT_FLAT %d C_PRIMARY C_SOME_AREA on\n",j);
	      
	      fprintf(newfile,"NOT_FLAT %d TOLERANCE_PRIMARY 0.0002\n",j);
	      
	      if((ATTRTYPE_MGCP3())||(ATTRTYPE_MGCP4()))
		{
		  fprintf(newfile,"NOT_FLAT %d ANNOTATION \"Area (HYP) Perennial Lakes not flat\"\n",j);
		}
		else if((ATTRTYPE_NFDD()))
		{
		  fprintf(newfile,"NOT_FLAT %d ANNOTATION \"Area (HYP) Perennial Inland Waterbodies not flat\"\n",j);
		}
		else if((ATTRTYPE_DFDD()))
		{
		  fprintf(newfile,"NOT_FLAT %d ANNOTATION \"Area (HYP) Perennial Lakes or Inland Waterbodies not flat\"\n",j);
		}
	      else if(
              (ATTRTYPE_ANY_TDS()) ||
		      (ATTRTYPE_ANY_GGDM())
		      )
		{
		  fprintf(newfile,
			  "NOT_FLAT %d ANNOTATION \"Area (ZI024_HYP) Perennial Inland Waterbodies not flat\"\n",j);
		}
	      else
		{
		  fprintf(newfile,
			  "NOT_FLAT %d ANNOTATION \"Area (HYC) Perennial/Permanent Lake/Ponds not flat\"\n",j);
		}
	      
	      j = j+1;
	    }
	  
	  
	  
	  if(docheck2==1)
	    {
	      fprintf(newfile,"NOT_FLAT %d C_PRIMARY C_ALL_AREA off\n",j);
	      fprintf(newfile,"NOT_FLAT %d C_PRIMARY C_SOME_AREA on\n",j);
	      
	      fprintf(newfile,"NOT_FLAT %d TOLERANCE_PRIMARY 0.0002\n",j);
	      

	      

	      if(
			  (ATTRTYPE_MGCP3())||(ATTRTYPE_MGCP4()) ||
			  (ATTRTYPE_NFDD())||
			  (ATTRTYPE_DFDD())
			  )
		{ 
		  fprintf(newfile,
			  "NOT_FLAT %d ANNOTATION \"Area (HYP) Perennial Reservoir not flat\"\n",j);
		}
	      else
		{
		  fprintf(newfile,
			  "NOT_FLAT %d ANNOTATION \"Area (HYC) Perennial/Permanent Reservoir not flat\"\n",j);
		}
	      
	      j = j+1;
	    }
	  
	  
	  
	  if(docheck3==1)
	    {
	      fprintf(newfile,"NOT_FLAT %d C_PRIMARY C_ALL_AREA off\n",j);
	      fprintf(newfile,"NOT_FLAT %d C_PRIMARY C_SOME_AREA on\n",j);
	      
	      fprintf(newfile,"NOT_FLAT %d TOLERANCE_PRIMARY 0.0002\n",j);
	      
	      fprintf(newfile,"NOT_FLAT %d ANNOTATION \"Area %s not flat\"\n",j,GetBuildingName(0));
	      
	      j = j+1;
	    }
	  
	  if(docheck4==1)
	    {
	      fprintf(newfile,"NOT_FLAT %d C_PRIMARY C_ALL_AREA off\n",j);
	      fprintf(newfile,"NOT_FLAT %d C_PRIMARY C_SOME_AREA on\n",j);
	      
	      fprintf(newfile,"NOT_FLAT %d TOLERANCE_PRIMARY 0.0002\n",j);
	      
		  fprintf(newfile,"NOT_FLAT %d ANNOTATION \"Area %s not flat\"\n",j,GetTidalWaterName(1));

	      
	      j = j+1;
	    }
	  
	  
	  fprintf(newfile,"ATTRATTRATTR\n");
	  
	  
	  j = 1;
	  if(docheck1==1)
	    {
		  if(perrenial_area_lake_found==1)
		  {
	        fprintf(newfile,"NOT_FLAT %d PRIMARY %s %s LABEL %s on C_AREA\n",
		      j,GetLakeName(0),GetHYCCode(0),GetPermanentName(0));
		  }
		  if(perrenial_area_iwb_found==1)
		  {
	        fprintf(newfile,"NOT_FLAT %d PRIMARY InlandWaterbody %s LABEL %s on C_AREA\n",
		      j,GetHYCCode(0),GetPermanentName(0));
		  }

	      j = j + 1;
	    }
	  
	  
	  if(docheck2==1)
	    {
	      
	      
	      fprintf(newfile,"NOT_FLAT %d PRIMARY Reservoir %s LABEL %s on C_AREA\n",
		      j,GetHYCCode(0),GetPermanentName(0));
	      
	      j = j + 1;
	    }


	  if(docheck3==1)
	    {
	      fprintf(newfile,"NOT_FLAT %d PRIMARY %s ANY on C_AREA\n",j,GetBuildingName(0));
	      j = j + 1;
	    }


	  if(docheck4==1)
	    {
		  fprintf(newfile,"NOT_FLAT %d PRIMARY %s ANY on C_AREA\n",j,GetTidalWaterName(0));
	      j = j + 1;
	    }
	  
	}
      else
	{
	  fprintf(newfile,"Data not available to specify this check\n");
	}
      fclose(newfile);
    }
}



