void DoPTOSIDEREGION(
		     int type,char *prefix,
		     int *codespresent,
		     int *mgcp_area_water,
		     int point_rig_srl1_found,
		     int point_moormast_found,
		     int point_intake_found,
		     int point_rig_srl2_found,
		     int area_tidal_water_found,
		     int area_aerodrome_found)
{
  FILE *newfile;
  char message[1000],cleancode[1000];
  int docheck1,docheck2,docheck3,i,j;

  if((type==2)||(type==5)||(type==6)||(type==7)||(type==8)||(type==11))
    {
      
      
      sprintf(message,"%sPTOSIDEREGION.txt",prefix);
      newfile = fopen(message,"w");
      ExeUpdate(message);
      
      
      docheck1  = 0;
      docheck2  = 0;
      docheck3  = 0;
      
      
	  if((type==5)||(type==6)||(type==7)||(type==8)||(type==11))
	  {
		if(point_rig_srl1_found>0)
		{
          docheck1 = 1;
		}
	  }

      if(point_moormast_found==1)
	{
	  docheck2  = 1;
	}
      
      if(point_intake_found==1)
	{
	  docheck3  = 1;
	}
      
      
      if( (docheck1+docheck2+docheck3) >0)
	{
	  fprintf(newfile,"UNIQUE_CHECKS 1\n");
	  fprintf(newfile,"PTOSIDEREGION %d\n",docheck1+docheck2+docheck3);
	  
	  
	  j = 1;
	  
	  if(docheck1==1)
	    {
	      fprintf(newfile,"PTOSIDEREGION %d C_PRIMARY C_ALL_POFE off\n",j);
	      fprintf(newfile,"PTOSIDEREGION %d C_PRIMARY C_SOME_POFE on\n",j);
	      
	      fprintf(newfile,"PTOSIDEREGION %d C_SECONDARY C_ALL_AREA off\n",j);
	      fprintf(newfile,"PTOSIDEREGION %d C_SECONDARY C_SOME_AREA on\n",j);
	      
	      
		  fprintf(newfile,"PTOSIDEREGION %d ANNOTATION \"Point Rig with SRL=\"Offshore\" not inside area %s\"\n",j,GetTidalWaterName(1));
	      
	      j = j+1;
	    }
	  
	  
	  
	  if(docheck2==1)
	    {
	      fprintf(newfile,"PTOSIDEREGION %d C_PRIMARY C_ALL_POFE off\n",j);
	      fprintf(newfile,"PTOSIDEREGION %d C_PRIMARY C_SOME_POFE on\n",j);
	      
	      fprintf(newfile,"PTOSIDEREGION %d C_SECONDARY C_ALL_AREA off\n",j);
	      fprintf(newfile,"PTOSIDEREGION %d C_SECONDARY C_SOME_AREA on\n",j);
	      
		  fprintf(newfile,
			  "PTOSIDEREGION %d ANNOTATION \"Point Mooring Mast not inside area %s\"\n",j,GetAirportName(1));

	      
	      j = j+1;
	    }
	  
	  if(docheck3==1)
	    {
	      fprintf(newfile,"PTOSIDEREGION %d C_PRIMARY C_ALL_POFE off\n",j);
	      fprintf(newfile,"PTOSIDEREGION %d C_PRIMARY C_SOME_POFE on\n",j);
	      
	      fprintf(newfile,"PTOSIDEREGION %d C_SECONDARY C_ALL_AREA off\n",j);
	      fprintf(newfile,"PTOSIDEREGION %d C_SECONDARY C_SOME_AREA on\n",j);
	      
	      if((type==5)||(type==6)||(type==7)||(type==8)||(type==11))
		{
		  if(
             (ATTRTYPE_ANY_TDS()) ||
		     (ATTRTYPE_NFDD())||
		     (ATTRTYPE_ANY_GGDM())
		     )
		    {
		      fprintf(newfile,
			      "PTOSIDEREGION %d ANNOTATION \"Point Water Intake Tower not inside area Inland Waterbody or River\"\n",j);
		    }
		  else if((ATTRTYPE_DFDD()))
		    {
		      fprintf(newfile,
			      "PTOSIDEREGION %d ANNOTATION \"Point Water Intake Tower not inside area Lake, Inland Waterbody, or River\"\n",j);
		    }
		  else if((ATTRTYPE_MGCP3())||(ATTRTYPE_MGCP4()))
		    {
		      fprintf(newfile,
			      "PTOSIDEREGION %d ANNOTATION \"Point Water Intake Tower not inside area River, Lake, or Reservoir\"\n",j);
		    }
		  else
		    {
		      fprintf(newfile,
			      "PTOSIDEREGION %d ANNOTATION \"Point Water Intake Tower not inside area River/Stream, Lake/Pond, or Reservoir\"\n",j);
		    }
		}
	      else  
		{
		  if(
             (ATTRTYPE_ANY_TDS()) ||
		     (ATTRTYPE_NFDD())||
		     (ATTRTYPE_ANY_GGDM())
		     )
		    {
		      fprintf(newfile,
			      "PTOSIDEREGION %d ANNOTATION \"Point Water Intake Tower not inside area Aqueduct, Canal, Ditch, Inland Waterbody, %s, or River\"\n",j,GetTidalWaterName(1));
		    }
		  else if((ATTRTYPE_DFDD()))
		    {
		      fprintf(newfile,
			      "PTOSIDEREGION %d ANNOTATION \"Point Water Intake Tower not inside area Aqueduct, Canal, Ditch, Lake, Inland Waterbody, %s, or River\"\n",j,GetTidalWaterName(1));
		    }
		  else if((ATTRTYPE_MGCP3())||(ATTRTYPE_MGCP4()))
		    {
		      fprintf(newfile,
			      "PTOSIDEREGION %d ANNOTATION \"Point Water Intake Tower not inside area Aqueduct, Canal, Ditch, River, Lake, %s, or Reservoir\"\n",j,GetTidalWaterName(1));
		    }
		  else
		    {
		      fprintf(newfile,
			      "PTOSIDEREGION %d ANNOTATION \"Point Water Intake Tower not inside area Aqueduct, Canal, Ditch, River/Stream, Lake/Pond, %s, or Reservoir\"\n",j,GetTidalWaterName(1));
		    }
		}
	      
	      j = j+1;
	    }
	  
	  
	  fprintf(newfile,"ATTRATTRATTR\n");
	  
	  j = 1;


	  if(docheck1>0)
	  { 
        if(point_rig_srl2_found>0)
		{ 
          fprintf(newfile,"PTOSIDEREGION %d PRIMARY Rig LocationReferencedtoShoreline LABEL Offshore on C_POFE\n",j);
		} 
        if(area_tidal_water_found>0)
		{ 
		  fprintf(newfile,"PTOSIDEREGION %d SECONDARY %s ANY on C_AREA\n",j,GetTidalWaterName(0));
		}

	    j = j+1;
	  }


	  if(docheck2>0)
	    {
	      fprintf(newfile,"PTOSIDEREGION %d PRIMARY MooringMast ANY on C_POFE\n",j);
	      
	      if(area_aerodrome_found==1)
		{
	      fprintf(newfile,"PTOSIDEREGION %d SECONDARY %s ANY on C_AREA\n",j,GetAirportName(0));
		}
	      j = j+1;
	    }
	  
	  if(docheck3>0)
	    {
	      fprintf(newfile,"PTOSIDEREGION %d PRIMARY WaterIntakeTower ANY on C_POFE\n",j);


	      for(i=0; i<INscc_loop;i++)
		{
		  if( (codespresent[i]==1) && (mgcp_area_water[i]==1) )
		    {
		      if(
			     (((type!=5)&&(type!=6)&&(type!=7)&&(type!=8)&&(type!=11))||(strcmp(GetECCLabel(i),GetTidalWaterName(1))))  && 
			     (((type!=5)&&(type!=6)&&(type!=7)&&(type!=8)&&(type!=11))||(strcmp(GetECCLabel(i),"Canal")))               && 
			     (((type!=5)&&(type!=6)&&(type!=7)&&(type!=8)&&(type!=11))||(strcmp(GetECCLabel(i),"Ditch")))                  
			    )
			{
			  sprintf(cleancode,"%s",MakeCleanCode(GetECCLabel(i)));
			  fprintf(newfile,"PTOSIDEREGION %d SECONDARY %s ANY on C_AREA\n",j,cleancode);
			}
		    }
		}
	      j = j+1;
	    }
	}
      else
	{
	  fprintf(newfile,"Data not available to specify this check\n");
	}
      fclose(newfile);
    }
}




