int ClassGeomPresent(char *classcode,int geom)
{
  int i;

  for(i=0;i<NumberOfModels;i++)
  {
	if(
		(  (geom==C_POFE)&&(!strcmp(MdlNames[i].name,"(POINT)")) ) ||
		(  (geom==C_LINE)&&(!strcmp(MdlNames[i].name,"(LINE)"))  ) ||
		(  (geom==C_AREA)&&(!strcmp(MdlNames[i].name,"(AREA)"))  )
      )
	{
	  if(  (!strcmp(GetECCLabel(MdlNames[i].code),classcode)))
	  {
        return 1;
	  }
	}
  }
  return 0;
}



char * GetGeomName(int geomcode)
{
  if(geomcode==C_POFE)
  {
	return "Point";
  }
  if(geomcode==C_LINE)
  {
	return "Line";
  }
  if(geomcode==C_AREA)
  {
	return "Area";
  }

  printf("GGN: Error %d\n",geomcode);
  return "Error!";
}




void DoMGCP_PORTRAYF(int type,char *prefix)
{
  FILE *newfile,*readfile;
  char message[1000],message2[1000],aline[1000],thiscode[1000];
  int i,j,k,totalchecks=0,line=0,thisgeom,ispresent;
  int *fcodes=NULL,*geoms=NULL;

  if((type==2) &&(ATTRTYPE_MGCP4()))
  {

    sprintf(message,"%sinspection_files%sMGCP_PortrayalAnalysis.txt",indirectory,GetSlash());
 
    newfile = fopen(message,"w");
    ExeUpdate(message);
 

	totalchecks = 0;

    if((USE_DOS==1)&&(SLASHTYPE==DOS_TYPE))
	{
	  sprintf(message2,"%sinternal_data\\PFF.bin",indirectory);
	}
    else
	{
	  sprintf(message2,"%sinternal_data/PFF.bin",indirectory);
	}
 
    readfile = fopen(message2,"r");
	if(readfile!=NULL)
	{
	  fgets(aline,1000,readfile);
	  line = 1;
	  while(!feof(readfile))
	  {
	    fgets(aline,1000,readfile);
		line = line + 1; 
	  }
	  rewind(readfile);



	  fcodes = (int *)malloc(SzI*line);
	  geoms  = (int *)malloc(SzI*line);



	  fgets(aline,1000,readfile);
	  line = 1;
	  while(!feof(readfile))
	  {
		if((strlen(aline)!=7)&&(strlen(aline)!=8)&&(strlen(aline)!=9))
		{
		  printf("Invalid file %s (%d/789)\n",message2,(int)strlen(aline));
		  printf(" Unable to create %s\n",message);
		  line = -1;
		  totalchecks = -1;
		  break;
		}

		if(aline[5]!=' ')
		{
		  printf("Invalid file %s (%d/space)\n",message2,aline[5]);
		  printf(" Unable to create %s\n",message);
		  line = -1;
		  totalchecks = -1;
		  break;
		}

		if     (aline[6]=='P') {thisgeom = C_POFE;}
		else if(aline[6]=='L') {thisgeom = C_LINE;}
		else if(aline[6]=='A') {thisgeom = C_AREA;}
		else
		{
		  printf("Invalid file %s (%c/PLA)\n",message2,aline[6]);
		  printf(" Unable to create %s\n",message);
		  line = -1;
		  totalchecks = -1;
		  break;
		}

		sprintf(thiscode,"%s",aline);
		thiscode[5] = '\0';

        k = GetCodeIndex(thiscode);

        ispresent = ClassGeomPresent(GetECCLabel(k),thisgeom);

        if(ispresent==0)
		{
          printf("Error: Found %s (line %d) not in the project.\n",aline,line);
		  printf(" Unable to create %s\n",message);
		  line = -1;
		  totalchecks = -1;
		  break;
		}

		fcodes[totalchecks] = k;
		geoms [totalchecks] = thisgeom;

		totalchecks = totalchecks + 1;



	    fgets(aline,1000,readfile);
	    fgets(aline,1000,readfile);
		line = line + 2;
	  }
	}
	else
	{
	  printf("Error: couldn't open %s\n",message2);
      printf("  Cannot generate %s\n",message);
	}



    if(totalchecks>0)
	{
	  fprintf(newfile,"UNIQUE_CHECKS 1\n");
	  fprintf(newfile,"PORTRAYF %d\n",totalchecks);


      rewind(readfile);

	  for(i=0;i<totalchecks;i++)
	  {
		j = i + 1;

        fprintf(newfile,"PORTRAYF %d C_PRIMARY C_ALL_POFE off\n",j);
        fprintf(newfile,"PORTRAYF %d C_PRIMARY C_SOME_POFE on\n",j);
        fprintf(newfile,"PORTRAYF %d C_PRIMARY C_ALL_LINE off\n",j);
        fprintf(newfile,"PORTRAYF %d C_PRIMARY C_SOME_LINE on\n",j);
        fprintf(newfile,"PORTRAYF %d C_PRIMARY C_ALL_AREA off\n",j);
        fprintf(newfile,"PORTRAYF %d C_PRIMARY C_SOME_AREA on\n",j);
	      
        fgets(aline,1000,readfile); 
        fgets(aline,1000,readfile); 

		k = strlen(aline);
		if(k>4)
		{
		  if(aline[k]<32)
		  {
			aline[k] = '\0';
		  } 
		  if(aline[k-1]<32)
		  {
			aline[k-1] = '\0';
		  } 
		  if(aline[k-2]<32)
		  {
			aline[k-2] = '\0';
		  } 
		}
		else
		{
		  printf("Error parsing annotation %s\n",aline);
		}

	    fprintf(newfile,"PORTRAYF %d ANNOTATION \"%s %s portrayal %s\"\n",
			  j,GetGeomName(geoms[i]),GetECCLabel(fcodes[i]),aline);
	  }



	  fprintf(newfile,"ATTRATTRATTR\n");



      rewind(readfile);

	  for(i=0;i<totalchecks;i++)
	  {
		j = i + 1;
	      
        fgets(aline,1000,readfile); 
        fgets(aline,1000,readfile); 

		k = strlen(aline);
		if(k>4)
		{
		  if(aline[k]<32)
		  {
			aline[k] = '\0';
		  } 
		  if(aline[k-1]<32)
		  {
			aline[k-1] = '\0';
		  } 
		  if(aline[k-2]<32)
		  {
			aline[k-2] = '\0';
		  } 
		}
		else
		{
		  printf("Error (2) parsing annotation %s\n",aline);
		}

        fprintf(newfile,"PORTRAYF %d PRIMARY %s ANY on %s\n",j,MakeCleanCode(GetECCLabel(fcodes[i])),ParseCName(geoms[i]));

	  }

	} 
    else
	{
	  fprintf(newfile,"Data not available to specify this check\n");
	}
    fclose(newfile);

	if(fcodes!=NULL)
	{
	  free(fcodes);
	}
	if(geoms!=NULL)
	{
	  free(geoms);
	}
	if(readfile!=NULL)
	{
	  fclose(readfile);
	}
  } 
}





