void DoFSFAIL(
	      int type,char *prefix,
	      int area_lock_found,
	      int area_tidal_water_found,
	      int area_canal_found,
	      int area_ditch_found,
	      int area_river_found,
	      int area_lake_found,
	      int area_iwb_found,
	      int area_reservoir_found,
		  int area_runway_found,
		  int area_taxiway_found,
		  int area_bridge_found,
		  int area_tunnel_found)
{
  FILE *newfile;
  char message[1000];
  int j,totalchecks,docheck1,docheck2,docheck3;


  if((type==1)||(type==2)||(type==5)||(type==6)||(type==11))
    {
      
      
      sprintf(message,"%sFSFAIL.txt",prefix);
      newfile = fopen(message,"w");
      ExeUpdate(message);
      
      totalchecks = 0;

      docheck1    = 0;
      docheck2    = 0;
      docheck3    = 0;
      
      if(area_lock_found>0)
	{
	  docheck1 = 1;
	}
     
      if(type==2)
	{
	  if(ATTRTYPE_MGCP3()==0)
	  {
        if(area_bridge_found>0)
		{
          docheck2 = 1;
          docheck2 = 0;
		}
        if(area_tunnel_found>0)
		{
          docheck3 = 1;
          docheck3 = 0;
		}
	  }
	}



      totalchecks = docheck1 + docheck2 + docheck3;
      
      
      if(totalchecks>0)
	{
	  fprintf(newfile,"UNIQUE_CHECKS 1\n");
	  fprintf(newfile,"FSFAIL %d\n",totalchecks);
	  
	  
	  j = 1;
	  
	  if(docheck1==1)
	    {
	      
	      fprintf(newfile,"FSFAIL %d C_PRIMARY C_ALL_AREA off\n",j);
	      fprintf(newfile,"FSFAIL %d C_PRIMARY C_SOME_AREA on\n",j);
	      
	      fprintf(newfile,"FSFAIL %d C_SECONDARY C_ALL_AREA off\n",j);
	      fprintf(newfile,"FSFAIL %d C_SECONDARY C_SOME_AREA on\n",j);
	      
	      if(
             (ATTRTYPE_ANY_TDS()) ||
		     (ATTRTYPE_NFDD())||
		     (ATTRTYPE_ANY_GGDM())
		    )
		 {
		   
		  fprintf(newfile,"FSFAIL %d ANNOTATION \"Area Lock not sharing some area with area Canal, Ditch, %s, %s, or Inland Waterbody\"\n",j,GetRiverName(1),GetTidalWaterName(1));
		 }
		 else if((ATTRTYPE_DFDD()))
		 {
		   
		  fprintf(newfile,"FSFAIL %d ANNOTATION \"Area Lock not sharing some area with area Canal, Ditch, %s, %s, %s, or Inland Waterbody\"\n",j,GetRiverName(1),GetLakeName(1),GetTidalWaterName(1));
		 }
	      else 
		{
		  fprintf(newfile,"FSFAIL %d ANNOTATION \"Area Lock not sharing some area with area Canal, Ditch, %s, %s, Reservoir, or %s\"\n",j,GetRiverName(1),GetLakeName(1),GetTidalWaterName(1));
		}
	    
	      j = j + 1;
	    }

  	  if(docheck2==1)
	    {
	      fprintf(newfile,"FSFAIL %d C_PRIMARY C_SOME_AREA on\n",  j);
	      fprintf(newfile,"FSFAIL %d C_PRIMARY C_ALL_AREA off\n",  j);
	      fprintf(newfile,"FSFAIL %d C_SECONDARY C_SOME_AREA on\n",j);
	      fprintf(newfile,"FSFAIL %d C_SECONDARY C_ALL_AREA off\n",j);
		  fprintf(newfile,"FSFAIL %d ANNOTATION \"Area %s not sharing some area with area Runway or Taxiway\"\n",j,GetBridgeName(1));
	      j = j + 1;
	    }

	  if(docheck3==1)
	    {
	      fprintf(newfile,"FSFAIL %d C_PRIMARY C_SOME_AREA on\n",  j);
	      fprintf(newfile,"FSFAIL %d C_PRIMARY C_ALL_AREA off\n",  j);
	      fprintf(newfile,"FSFAIL %d C_SECONDARY C_SOME_AREA on\n",j);
	      fprintf(newfile,"FSFAIL %d C_SECONDARY C_ALL_AREA off\n",j);
		  fprintf(newfile,"FSFAIL %d ANNOTATION \"Area Tunnel not sharing some area with area Runway or Taxiway\"\n",j);
	      j = j + 1;
	    }
	  
	  fprintf(newfile,"ATTRATTRATTR\n");
	  
	  j = 1;
	  
	  if(docheck1==1)
	    {
	      
	      fprintf(newfile,"FSFAIL %d PRIMARY Lock ANY on C_AREA\n",j);
	      
	      if(area_tidal_water_found==1)
		{
	      fprintf(newfile,"FSFAIL %d SECONDARY %s ANY on C_AREA\n",j,GetTidalWaterName(0));   
		}
	      if(area_canal_found==1)
		{
		  fprintf(newfile,"FSFAIL %d SECONDARY Canal ANY on C_AREA\n",j);
		}
	      if(area_ditch_found==1)
		{
		  fprintf(newfile,"FSFAIL %d SECONDARY Ditch ANY on C_AREA\n",j);
		}
	      if(area_river_found==1)
		{
	      fprintf(newfile,"FSFAIL %d SECONDARY %s ANY on C_AREA\n",j,GetRiverName(0));
		}
	      if(area_lake_found==1)
		{
	      fprintf(newfile,"FSFAIL %d SECONDARY %s ANY on C_AREA\n",j,GetLakeName(0));
		}
	      if(area_iwb_found==1)
 		{
	      fprintf(newfile,"FSFAIL %d SECONDARY InlandWaterbody ANY on C_AREA\n",j);
		}
	      if(area_reservoir_found==1)
		{
		  fprintf(newfile,"FSFAIL %d SECONDARY Reservoir ANY on C_AREA\n",j);
		}
	      
	      j = j + 1;
	    }


	  if(docheck2==1)
	    {
          if(area_bridge_found==1)
		  {
		    fprintf(newfile,"FSFAIL %d PRIMARY %s ANY on C_AREA\n",j,GetBridgeName(0));
		  }
          if(area_runway_found==1)
		  {
		    fprintf(newfile,"FSFAIL %d SECONDARY Runway ANY on C_AREA\n",j);
		  }
	      if(area_taxiway_found==1)
		  {
		    fprintf(newfile,"FSFAIL %d SECONDARY Taxiway ANY on C_AREA\n",j);
		  }

	      j = j + 1;
	    }	  

	  if(docheck3==1)
	    {
          if(area_tunnel_found==1)
		  {
		    fprintf(newfile,"FSFAIL %d PRIMARY Tunnel ANY on C_AREA\n",j);
		  }
          if(area_runway_found==1)
		  {
		    fprintf(newfile,"FSFAIL %d SECONDARY Runway ANY on C_AREA\n",j);
		  }
	      if(area_taxiway_found==1)
		  {
		    fprintf(newfile,"FSFAIL %d SECONDARY Taxiway ANY on C_AREA\n",j);
		  }

	      j = j + 1;
	    }	  
	}
      else
	{
	  fprintf(newfile,"Data not available to specify this check\n");
	}
      fclose(newfile);
    }
}




