void DoFAILMERGEA(
		  int type,char *prefix,
		  int *codespresent,
		  int *mgcp_landcover,
		  int some_areas_found,
		  int mgcp_landcover_found,
		  int area_building_found,
		  int area_span_found,
		  int area_river_nam_unk)
{
  FILE *newfile;
  char message[1000],cleancode[1000];
  int docheck1,i,j,totalchecks;

  if(type==2)
  { 
    

    sprintf(message,"%sFAILMERGEA2.txt",prefix);
    newfile = fopen(message,"w");
    ExeUpdate(message);
      
    if(mgcp_landcover_found>0)
	{ 
	  fprintf(newfile,"UNIQUE_CHECKS 1\n");
	  fprintf(newfile,"FAILMERGEA2 1\n");
	  
	  fprintf(newfile,"FAILMERGEA2 1 C_PRIMARY C_ALL_AREA off\n");
	  fprintf(newfile,"FAILMERGEA2 1 C_PRIMARY C_SOME_AREA on\n");
	  fprintf(newfile,"FAILMERGEA2 1 ANNOTATION \"Area feature merge failure on Landcover features\"\n");
	  fprintf(newfile,"ATTRATTRATTR\n");
	  
	  for(i=0; i<INscc_loop;i++)
	  {  
	    if( (codespresent[i]==1) && (mgcp_landcover[i]==1) )
		{ 
		  sprintf(cleancode,"%s",MakeCleanCode(GetECCLabel(i)));
		  fprintf(newfile,"FAILMERGEA2 1 PRIMARY %s ANY on C_AREA\n",cleancode);
		} 
	  } 

	  if(area_river_nam_unk>0)
	  {
        fprintf(newfile,"FAILMERGEA2 1 PRIMARY %s %s STRING \"UNK\" off C_AREA\n",GetRiverName(0),MakeCleanCode2(GetEACLabel(GetAttrIndex("NAM"))));
	  }

	} 
    else
	{ 
	  fprintf(newfile,"Data not available to specify this check\n");
	} 
    fclose(newfile);
  }

  else if((type==5)||(type==6)||(type==7)||(type==8)||(type==11))
  {
	 
      
     sprintf(message,"%sFAILMERGEA.txt",prefix);
     newfile = fopen(message,"w");
     ExeUpdate(message);
      
     docheck1 = 0;

     if(some_areas_found>0)
	 {
       docheck1 = 1;
	 }

	 totalchecks = docheck1;

	 if(totalchecks>0)
	 {
       fprintf(newfile,"UNIQUE_CHECKS 1\n");
       fprintf(newfile,"FAILMERGEA %d\n",totalchecks);

	   j = 1;

	   if(docheck1>0)
	   {
         fprintf(newfile,"FAILMERGEA 1 C_PRIMARY C_ALL_AREA on\n");
         fprintf(newfile,"FAILMERGEA 1 C_PRIMARY C_SOME_AREA off\n");

         if((area_span_found>0)&&(area_building_found>0))
		 {
           fprintf(newfile,"FAILMERGEA 1 ANNOTATION \"Area feature merge failure (Bridge Span and Buildings excluded)\"\n");
		 }
         else if(area_span_found>0)
		 {
           fprintf(newfile,"FAILMERGEA 1 ANNOTATION \"Area feature merge failure (Bridge Spans excluded)\"\n");
		 }
         else if(area_building_found>0)
		 {
           fprintf(newfile,"FAILMERGEA 1 ANNOTATION \"Area feature merge failure (Buildings excluded)\"\n");
		 }
		 else
		 {
           fprintf(newfile,"FAILMERGEA 1 ANNOTATION \"Area feature merge failure\"\n");
		 }

		 j = j + 1;
	   }

       fprintf(newfile,"ATTRATTRATTR\n");

	   j = 1;

	   if(docheck1>0)
	   {

	     if(area_building_found>0)
		 {
           fprintf(newfile,"FAILMERGEA %d PRIMARY %s ANY off C_AREA\n",j,GetBuildingName(0));
		 }

		 if(area_span_found>0)
		 {
           fprintf(newfile,"FAILMERGEA %d PRIMARY BridgeSpan ANY off C_AREA\n",j);
		 }

		 j = j + 1;
	   }
	 }
     else
	 { 
	   fprintf(newfile,"Data not available to specify this check\n");
	 }
    fclose(newfile);
  }
}




