void DoPSHOOTL(
	       int type,char *prefix,
	       int point_aqueduct_found,
	       int line_aqueduct_found,
	       int point_culvert_found,
	       int line_road_found,
	       int line_ctrack_found,
	       int line_trail_found,
	       int line_rail_found,
	       int line_sidetrack_found,
	       int line_ditch_found,
	       int line_river_found,
	       int line_canal_found)
{
  FILE *newfile;
  char message[1000];
  int docheck1,docheck2,j,totalchecks;


  
      
  if((type==2)||(type==5)||(type==6)||(type==7)||(type==8)||(type==11))
  {

    sprintf(message,"%sPSHOOTL.txt",prefix);
    newfile = fopen(message,"w");
    ExeUpdate(message);
          
    docheck1 = 0;
    docheck2 = 0;
      
  
    if(type==2)
	{ 
      if((point_aqueduct_found>0)&&(line_aqueduct_found>0))
	  {    
	    docheck1 = 1;
	  }   
	} 
  
	
  
      
    totalchecks = docheck1 + docheck2;
      
      
    if(totalchecks>0)
	{
	  fprintf(newfile,"UNIQUE_CHECKS 1\n");
	  fprintf(newfile,"PSHOOTL %d\n",totalchecks);
	  
	  j = 1;
	  
	  if(docheck1==1)
	    { 
	      fprintf(newfile,"PSHOOTL %d C_PRIMARY C_ALL_POFE off\n",j);
	      fprintf(newfile,"PSHOOTL %d C_PRIMARY C_SOME_POFE on\n",j);
	      fprintf(newfile,"PSHOOTL %d C_SECONDARY C_ALL_LINE off\n",j);
	      fprintf(newfile,"PSHOOTL %d C_SECONDARY C_SOME_LINE on\n",j);	  
	      if((ATTRTYPE_MGCP3())||(ATTRTYPE_MGCP4()))
		{
		  fprintf(newfile,"PSHOOTL %d ANNOTATION \"Point Aqueduct (Qanat Shaft) within 10m but not coincident with line Aqueduct\"\n",j);
		}
	      else
		{
		  fprintf(newfile,"PSHOOTL %d ANNOTATION \"Point Aqueduct within 10m but not coincident with line Aqueduct\"\n",j);
		}
	      
	      fprintf(newfile,"PSHOOTL %d TOLERANCE_PRIMARY .1\n",j);
	      fprintf(newfile,"PSHOOTL %d TOLERANCE_SECONDARY 10\n",j);
	      j = j + 1;
	    }
	  
	  
	  if(docheck2==1)
	    { 
	      fprintf(newfile,"PSHOOTL %d C_PRIMARY C_ALL_POFE off\n",j);
	      fprintf(newfile,"PSHOOTL %d C_PRIMARY C_SOME_POFE on\n",j);
	      fprintf(newfile,"PSHOOTL %d C_SECONDARY C_ALL_LINE off\n",j);
	      fprintf(newfile,"PSHOOTL %d C_SECONDARY C_SOME_LINE on\n",j);	  
	      
	      fprintf(newfile,"PSHOOTL %d ANNOTATION \"Point Culvert within 5m but not coincident with line Road, Cart Track, Trail, %s, %s, Ditch, Aqueduct, Canal, or %s\"\n",
		      j,GetRailName(1),GetSideTrackName(1),GetRiverName(1));
	      
	      fprintf(newfile,"PSHOOTL %d TOLERANCE_PRIMARY .01\n",j);
	      fprintf(newfile,"PSHOOTL %d TOLERANCE_SECONDARY 5\n",j);
	      j = j + 1;
	    }
	  
	  
	  fprintf(newfile,"ATTRATTRATTR\n");
	  
	  j = 1;
	  
	  if(docheck1==1)
	    {  	      
	      fprintf(newfile,"PSHOOTL %d PRIMARY Aqueduct ANY on C_POFE\n",j);
	      fprintf(newfile,"PSHOOTL %d SECONDARY Aqueduct ANY on C_LINE\n",j);
	      j = j + 1;
	    }  
	  
	  if(docheck2==1)
	    {  	      
	      fprintf(newfile,"PSHOOTL %d PRIMARY Culvert ANY on C_POFE\n",j);
	      
	      if(line_road_found==1)
		{
		  fprintf(newfile,"PSHOOTL %d SECONDARY %s ANY on C_LINE\n",j,GetRoadName(0));
		}
	      
  	      if(line_ctrack_found==1)
		{
		  fprintf(newfile,"PSHOOTL %d SECONDARY CartTrack ANY on C_LINE\n",j);
		}
	      
	      if(line_trail_found==1)
		{
		  fprintf(newfile,"PSHOOTL %d SECONDARY Trail ANY on C_LINE\n",j);
		}
	      
	      if(line_rail_found==1)
		{
		  fprintf(newfile,"PSHOOTL %d SECONDARY %s ANY on C_LINE\n",j,GetRailName(0));
		}
	      
	      if(line_sidetrack_found==1)
		{
		  fprintf(newfile,"PSHOOTL %d SECONDARY %s ANY on C_LINE\n",j,GetSideTrackName(0));
		}
	      
	      if(line_ditch_found==1)
		{
		  fprintf(newfile,"PSHOOTL %d SECONDARY Ditch ANY on C_LINE\n",j);
		}
	      
	      if(line_river_found==1)
		{
		  fprintf(newfile,"PSHOOTL %d SECONDARY %s ANY on C_LINE\n",j,GetRiverName(0));
		}
	      
	      if(line_canal_found==1)
		{  
		  fprintf(newfile,"PSHOOTL %d SECONDARY Canal ANY on C_LINE\n",j);
		}  
	      
	      if(line_aqueduct_found==1)
		{  
		  fprintf(newfile,"PSHOOTL %d SECONDARY Aqueduct ANY on C_LINE\n",j);
		}
	      
	      j = j + 1;
	    }  
	}
      else
	{
	  fprintf(newfile,"Data not available to specify this check\n");
	}
      fclose(newfile);
  }
}




