int *line_bnd_checks = NULL;
int *area_bnd_checks = NULL;

void GetTotalAttrChecks(int *numlinechecks,int *numareachecks,int *linespresent,int *areaspresent)
{
  FILE *specfile;
  char aline[1000],onoff[1000],fcode[1000],geom[1000];
  int i,thisindex;

  extern char *GetBoundaryMatchFile();
  extern char * IGetNth(char aline[], int num, int silent);


  

  *numlinechecks = 0;
  *numareachecks = 0;

  specfile = fopen(GetBoundaryMatchFile(),"r");
  if(specfile==NULL)
  {
    printf("Error: couldn't open %s for read\n",GetBoundaryMatchFile());
	printf("cannot create boundary matching files\n");
	return;
  }

  line_bnd_checks = (int *)malloc(sizeof(int)*(INscc_loop + 10));
  area_bnd_checks = (int *)malloc(sizeof(int)*(INscc_loop + 10));

  for(i=0;i<INscc_loop;i++)
  {
	line_bnd_checks[i] = 0;
	area_bnd_checks[i] = 0;
  }

  fgets(aline,1000,specfile);
		
  while(!feof(specfile))
  {
	sprintf(onoff,"%s",IGetNth(aline,0,0));
	if((onoff[0]=='1')||(onoff[0]=='2'))
	{
      sprintf(fcode,"%s",IGetNth(aline,4,0));

	  if(!strncmp(fcode,"All",3))
	  {
        

        for(i=1;i<INscc_loop;i++) 
		{ 
	      line_bnd_checks[i] = 1;
	      area_bnd_checks[i] = 1;
		} 

		break;
	  }


	  thisindex = GetCodeIndex(fcode);

      sprintf(geom,"%s",IGetNth(aline,5,0)); 

	  if(thisindex>=0)
	  {
		if(!strncmp(geom,"All",3))
		{
          

          for(i=1;i<INscc_loop;i++) 
		  {  
	       line_bnd_checks[i] = 1;
	       area_bnd_checks[i] = 1;
		  }  
		  break;
		}
	    else if(geom[0]=='A')
		{
		  if(areaspresent[thisindex]>0)
		  {
		    area_bnd_checks[thisindex] = 1;
		  }
		}
		else if(geom[0]=='L')
		{
		  if(linespresent[thisindex]>0)
		  {
		    line_bnd_checks[thisindex] = 1;
		  }
		}
		else
		{
		  printf("invalid geom %s (expected A or L) in column 6 of %s...ignoring this row\n",geom,GetBoundaryMatchFile());
		}
	  }
	}

    fgets(aline,1000,specfile);
  }


  for(i=0;i<INscc_loop;i++)
  {
	if(line_bnd_checks[i]>0)
	{
      *numlinechecks = *numlinechecks + 1;
      
	}
	else if(linespresent[i]>0)
	{
	  
	}

	if(area_bnd_checks[i]>0)
	{
      *numareachecks = *numareachecks + 1;
	}
	else if(areaspresent[i]>0)
	{
	  
	}
  }


  


  fclose(specfile);
}



